def printarg( I, x, y ):
  print("Przedzialy: ", limit(I,120))
  print("x         : ", x)
  print("y         : ", y)

def printhint( hint ):
  print("Przykladowy wynik:", limit(hint,120) )
  
def printsol( sol ):
  print("Uzyskany wynik   :", limit(sol,120) )

 
def check( I, x, y, hint, sol ):
  sol = sorted( sol )
  if hint == sol:
    print("Test zaliczony")
    return True
  else:
    print("NIEZALICZONY!")
    return False
    


def runtests( f ):
  internal_runtests( printarg, printhint, printsol, check, TESTS, f )
